what-is-typescript.html.body:
What?
The official tagline for TypeScript is "JavaScript that scales!" It justifies this tagline through these two features:
1. TypeScript is a superset of JavaScript.
2. TypeScript is a statically-typed programming with powerful control-flow based type analysis.
How is it a superset?
All valid JavaScript programs are valid TypeScript programs! TypeScript adds optional typing that users can buy into as much as they want to.
// Super simple TypeScript example.
function addNumbers(x: number, y: number): number {
    return x + y;
}

const z: number = 5;

// Same example as above, but no types.
function addNumbers(x, y) {
    return x + y;
}

const z = 5;

The two examples above are both valid TypeScript programs. The type annotations are optional. Perhaps unsuprisingly, writing TypeScript without types is basically just writing JavaScript. 
What the heck does control-flow based type analysis mean?
When doing type analysis, TypeScript reads through your code line by line parsing your code to figure out the type of a variable to give the most precise type possible.
For example:

function handleNumbersOrStrings (numberOrString: number | string): void {
    let numberSum: number = 5;
    let resultString: string = "what is typescript";
    if (typeof numberOrString === "number") {
        numberSum += numberOrString;
    } else { 
        resultString += numberOrString.toLowerCase();
    }
}

In the above example TypeScript can do some really cool stuff with this control-flow based type-analysis. While checking your code, it'll read it line by line as I've said before. But something interesting happens when it gets into these if else clauses. Within the if statement, TypeScript can reason that the type of numberOrString MUST be a number since it can only get inside here IF the type of numberOfString is number. Thus, TypeScript can guarantee that numberSum will remain a number as we are just adding another number to it. Similarly for the else clause, TypeScript will reason that numberOfString was typed to be one of two types. Inside this else clause it will realize that numberOrString MUST be a string here, therefore it has access to string methods such as toLowerCase();. (You can check me yourself by throwing this function into the official TypeScript Playground here! Link)
Without this control-flow based type-analysis the type analysis must just reason numberOrString is just the type number | string because it cannot get any more accurate.
These type checks manifest themselves either on the IDE (VSCode is built to go really well with TypeScript) you are using, or in console output when you attempt to compile TypeScript.
But why does this make JavaScript SCALE?
The ability to buy-in is quite powerful. The more type annotations we add to our code the more TypeScript can typecheck for us. TypeScript will watch vigilantly, yelling at us when we pass in parameters that don't match the types. 
But, it is only as strict as we want/need it to be.
Notably developers have found that simply porting their JavaScript codebase to TypeScript and gradually adding types reveals numerous bugs that just did not get caught. JavaScript alone will never check if you are passing in the expected parameters, it simply can never really know what to expect without type annotations.
Null safety and type safety are life savers as they are often at the root of many hard-to-trace bugs. They are a great way to address famous "billion dollar mistake" and save valuable time and money doing far more interesting things than tracing down what the heck propagating an undefined through the codebase. Like deploying to production,or planning yourself a nice siesta.
I'm not convinced yet?
Providing type annotations doubly acts as beautiful documentation for code. Plus, you can opt-in as much as you want! Maybe you are just not ready to convert your older JavaScript code base entirely over to TypeScript. You can steadily port as much as you want over, because in the end, TypeScript just transpiles to JavaScript! Transpiling here meaning that, our source code (TypeScript) gets translated to a very similar language (JavaScript). You can also tell TypeScript to be as strict as you need to it to be. Of course, the more strict options you enable the more TypeScript can do for you!
TypeScript adds a lot of safety checks and quality of life features to VSCode for JavaScript. For example, it provides a lot of auto-completion for JavaScript in VSCode that just wasn't possible before.
In the end if that's still not convincing and you just refuse to look at the rest of this cookbook, that's OK. Maybe we can't be friends. But this hosted cookbook will always be left open for you to come back.

tsconfig.html.body:
What is a TSCONFIG file
The TypeScript compiler is extensively configurable. It figures out what settings are on through parsing a file known as tsconfig.json. If the TypeScript compiler finds a tsconfig.json file then it automatically considers the directory it is in as the root directory of a TypeScript project. The following are various fields you can have in your file. Don't forget it is a JSON file, so we follow normal JSON syntax.
Compiler Options
The options in here tell TypeScript how to compile your files. In here is where you can specify how strict or un-strict you prefer TypeScript to be when it checks your code.
Example of a tsconfig.json file with various compiler options:
    {
        "compilerOptions": {
            "module": "commonJs",
            "noImplicitAny": true,
            "outDir": "./built",
            "target": "es2016",
            "strictNullChecks": true,
            "noImplicitReturns": true,
            "rootDir": "src"
        }
    }

We'll discuss each of the flags here. I will only be listing some of the possible values, as a full list of options and their options can be found on the official TypeScript handbook here.
module

Type: string
Example Possible values: "CommonJS", "AMD", "ES2015"...
Description: Tells TypeScript what to transpile modules into.

noImplicitAny

Type: boolean
Description: TypeScript will require all values for which TypeScript cannot do type inference (aka has an any type) to be declared explictly any.
Example:function returnSelf(x) { // TypeScript will point this out as an error because `x` cannot be type inferred to a type.
  return x;
}

We can fix this by doing:
TypeScript02:07 AM
function returnSelf(x: any) {
  return x;
}

outDir

Type: string
Example possible values: "./output", "./built"
Description: Tells TypeScript where to place its generated files after it compiles successfully.

target

Type: string
Example possible values: "ES5", "ESNext", "ES2015"...
Description: Tells TypeScript what to transpile the source code into. Allows you to use modern JS features that's backed by static checking for potentially dated platforms as well!

strictNullChecks

Type: boolean
Description: Does not place any in the domain of other types besides the domain of the null, undefined, and void types. 
Example:let favoriteNumber = 56; 
favoriteNumber = null; // TypeScript will error out here because `null` is not a part of the `number` type.

Can fix by doing:let favoriteNumber: number | null = 56; 
favoriteNumber = null;



This will force us to remember to deal with the possibility of favoriteNumber being null later on. It is a common mistake for developers to forget at some point a variable could be null. With this option, TypeScript will remember for you, and remind you about it later. 
noImplicitReturns

Type: boolean
Description: Will error out when functions that are expected to return a value do not return a value in all code paths.
Example:

function printMoney(money: number) void {
    console.log(money);
} // No error in this function!


function getMoney(): number { // Will error out here because we promised we would return a number value!

}


function getMoney(id: string): number { // Will error out here because not ALL code paths return a number value.
    if (id === "TypeScript") {
        return 9999999;
    }

    return 0;
}

rootDir

Type: string
Description: Tells TypeScript where the root directory of the files it needs to compile are. 

strict

Type: boolean
Description: A useful convenience flag which turns on all strict type checking for you, such as strictNullChecks and so on. Check out the official handbook to see the full list of flags that get turned on.    

Again, a much more thorough and detailed table of all the possible compiler options for TSCONFIG can be found in the official TypeScript handbook!

basic-coding.html.body:
Can we code now?
Sure. 
We'll run through some basic code snippets to get you started with TypeScript. Don't forget TypeScript syntactically is JavaScript with type annotations. If you know JavaScript, this'll be pretty quick! If not, I'll try to get you started coding wise as quick as possible.
To test code quickly without setting up a project use the TypeScript Playground!
const a = ""; 
// TypeScript can automatically type infer this to be a string.
// Additionally, since the variable `a` is `const` it can never be reassigned.
const b: string = "If you really feel the need to, you can type this. There's *not* really a need.";
// A function that takes in parameter `message` typed as a string and does not return anything.
function print(message: string): void {
    console.log(message);
}

print("Hello, world!");
print("             ");
print(a);
print(b);
print(11222); // This will be flagged as an error by TypeScript!

// Variables declared with let can be reassigned and mutated freely!
let numberStringArray: (number | string)[]; 
numberStringArray.push(5);
numberStringArray.push("5");

function checkForANumberAndString(numberStringArray: (number | string)[]): boolean {
    // We have access to array methods here since!
    return numberStringArray.has(x => typeof(x) === "number") && numberStringArray.has(x => typeof(x) === "string");
}

// Basic examples of expressions.
const numberValue = 5 + 5 * 5 / 2 - (-10); // 27.5
const stringValue = "Hello" + ",".concat(" ") + "world."; // "Hello, world."
const booleanValue = (5  number = (x: number) => x;
let answer: number = functionWhichReturnsANumber(999);

// TypeScript infers this type as well!
const objectValue = {
    name: "TypeScript Cookbook",
    year: 2018,
    description: "best"
};


// This is a type alias! It declares a type that we can reuse later called `Year`.
type Year = number | string[] | string;  
function giveYearBack(x: Year): Year {
    return x;
}

// This is an interface type. This is used to described 
// the structure of a specific object type.
interface DateInfo {
    month: number | string;
    year: number | string;
    day: number | string;
}

type Info = Year | DateInfo;

function printInfo(x: Info): void {
    console.log(x);
}

const currentDate: DateInfo = {
    month: 12,
    year: "2018",
    day: 13
};

if (currentDate.year === "2018") {
    console.log("This is the year this cookbook was originally written!");
}

printInfo(currentDate);

built-in.html.body:
Built-in types
Types in programming languages can accurately be described as sets of values. We'll be taking a look at the fundamental types built-in to TypeScript to tell us what we can use in our type annotations.

Boolean
A basic type, it represents the set of values true and false. 
let logicalResult: boolean = true;
logicalResult = false;
logicalResult = 5 > 3;

Number
TypeScript does not differentiate between different floats, doubles, integers etc. More accurately, all numbers are floating point values.
let numberResult = 5 + 3 - 1;
numberResult = 0.444444444 * -1;

String
The string type represents text. There is no smaller type such as the character type. Thus, it can be zero or more characters surrounded by single quotes 'test' or double quotes "test".
let aString = "goodbye.";
aString = 'so soon';

Any
The any type can be used to opt out of type checking. "Any" matches with all types. It can also be used to describe values that we might not know the type of at the time of writing. Or potentially "catch" all functions. As the official TypeScript documentation notes on the any type, it can be used while porting existing to JavaScript code to TypeScript, and then later one may go back and fill in the types gradually. 
let anything: any = "this";
anything = 'can';
anything = 4;
anything = false;
anything = ["be", "anything"];

Array
The array type represents a collection of values of homogeneous types. The following are equivalent ways to declare an array type.
const numberArray: number[] = [1, 2, 3];

const numberArray: Array = [1, 2, 3];

const multiTypeArray: (number | string)[] = [1, 2, "3"];
const anyTypeArray: any[] = [1, 2, "uh", "typescript", true];

Tuple
The tuple type is similar to array, but have a fixed length. They can also be heterogeneous. Useful for when you will know confidently what the length will be of the collection every time. 
We'll see elements of place-oriented programming here as order does matter.
let tupleValue: [number, string, string];
tupleValue = ["brook", "crook", -43]; // TypeScript will error out here!
tupleValue = [-41, "cook", "book"];

Enum
Enums give you a collection of labelled resuable values. 
enum Directions {Up, Down, Left, Right}
let currentDirection = Directions.Up;

if (currentDirection === Directions.Up) {
    console.log("It's up!");
} else if (currentDirection === Directions.Left) {
    console.log("Same as my non-dominant hand.");
} else if (currentDirection === Directions.Right) {
    console.log("No comment.");
} else {
    console.log("We don't believe in this direction.");
}

Void
void is normally used to describe the return values of functions that do not return anything. It can be used to describe variable types. This describes the set of only null or undefined.
function doSomething(): void{
    console.log("I did it.")
};

doSomething();

const x: void = undefined;

Null and Undefined
null and undefined are both the only members of their respective sets. However, they are subtypes of all other built-in types unless users remember to turn on strictNullCheck (as recommended by the TypeScript Handbook). With this flag on null and undefined are no longer subtypes of other types.
This is recommended because it address the million dollar mistake! Normally, null and undefined as part of other types allows these values to propagate through as developers commonly forget to account for these values coming up in their program. These commonly result in null-reference exceptions. But, turning the flag on will force developers to account for the possibility of null and undefined. We cannot really use null and undefined on their own, but with the strictNullCheck on we can union these types with other built-ins to force us to remember to handle nullable types.
// Assuming we have `strictNullCheck` on:
function compute(n: number | null): number{
    return n + 5; // Won't compile! TypeScript knows this could be possibly `null`!
}

// Assuming we have `strictNullCheck` on:
function computeButZeroIfNull(n: number | null): number{
    if (n === null) { 
        return 0;
    }
    // An example of control-flow based analysis! TypeScript can reason here
    // that we checked if it was null earlier, so here `n` MUST be number at 
    // this point.
    return n + 5; 
}

Never
A never value can never be assigned to ANY other type, even any. It is meant to describe values which in code that will be reached.
function throwAnError(): never {
    throw new Error("This function will never return a value.");
}

Object
object is a type meant for making built-in library functions make better sense in this type system. Additionally, they represent the set of values of non-primitives such as NOT number, boolean, string etc.
